  /**
    * Generate a valid JSON file of specific size
    *
    * @param sizeInKb
    * @return
    */
  def generate(sizeInKb: Int): String = {

    var out: String = "["

    for (i <- 0 until sizeInKb) {
      out += oneKb
      if (i < sizeInKb) {
        out += ","
      }
    }

    out += "]"
    out
  }

